import React from 'react';
import {BrowserRouter as Router} from "react-router-dom";
import {useRoutes} from "../../routes";
import './app.css';

function App() {
    return (
        <Router>
            <div className="App container">
                {useRoutes(true)}
            </div>
        </Router>
    );
}

export default App;
